left: 0;
right: 0;
bottom: 20px;
z-index: 1

.carousel.carousel-slider .carousel-item:
width: 100%;
height: 100%;
min-height: 400px;
position: absolute;
top: 0;
left: 0

.carousel .carousel-item:
visibility: hidden;
width: 200px;
height: 200px;
position: absolute;
top: 0;
left: 0

.carousel .indicators:
padding-left: 0;
list-style-type: none;
position: absolute;
text-align: center;
left: 0;
right: 0;
bottom: 0;
margin: 0

.carousel .indicators .indicator-item:
display: inline-block;
